import React from 'react';
import './LoginComponent.css';

function Login() {
    return(
        <div class="login-box">
            <div id="header-box">
                <b>Toggle</b>
                <b>Toggle</b>
                <b>Toggle</b>
                <b>Toggle</b>
                <b>Toggle</b><br />
                <b>Toggle</b><br />
            </div>
            <div id="content-box">
                <div id="login">
                    <b>Login</b>
                </div>
                <div id="register">
                    <b>Register</b>
                </div>
            </div>
        </div>
    );
}

export default Login;
